  false,\n\t\"url\": null,\n\t\"notes\": \"This summarizes the waterbird survey work
  done at Patuxent Research Refuge in 2008. Canada geese, wood ducks, mallards, hooded
  mergansers, pied-billed grebes, belted kingfishers, killdeer and great blue herons
  were below the ten year average. Black ducks, ring-neck ducks, green herons and
  bald eagles were near average and ospreys well above average.\",\n\t\"license_title\":
